body:
Привет новый кодер бурбон, буза его проверил, чем занимаемся сказал он согласился, жабу настроил вот жду его пока в онлайн выйдет для оплаты ТЗ
и к кому его потом , буза в отпуске 
[16:02:01] <psyverg> и всвязи с тем что буза и реверс в отпуске можно мне тоже пойти? 
[16:02:52] <psyverg> как раз у меня доступ закончился в воскресенье, а там новая политика и ХХ теперь 100 кликов в день стоит :
С 1 августа 2020 г. hh.ru ввел самое крупное изменение - перешел на новую модель работы с базой резюме. Если кратко, то сильно сократил количество резюме. Теперь компании дается 1280 резюме на месяц, НА всех менеджеров или 45 резюме в день. Ранее давалось 8000 резюме в день. Полная информация по тарифам здесь https://hhcdn.ru/file/16899324.pdf

Мои условия, соответственно также изменятся.
Теперь цена на доступ будет зависеть от количества просмотренных вами резюме:

1. При просмотре 30 резюме в сутки:
   - неделя:       4000 руб;
   - 2 недели:    6000 руб;
   - месяц:         10000 руб;
   - 3 месяца:    25000 руб.

2. При просмотре 50 резюме в сутки:
   - неделя:       5000 руб;
   - 2 недели:    8000 руб;
   - месяц:         13000 руб;
   - 3 месяца:    35000 руб.

3. При просмотре 100 резюме в сутки:
   - неделя:       6000 руб;
   - 2 недели:    9000 руб;
   - месяц:         15000 руб;
   - 3 месяца:    40000 руб.

Доступ к SJ (30 резюме в сутки):
   - неделя:       3500 руб;
   - 2 недели:    6000 руб;
   - месяц:         8000 руб;
   - 3 месяца:    22000 руб.

При покупке 2-х ресурсов (HH+SJ) скидка 10%.

[16:04:13] <psyverg> с реверсом договорился что новый админ будет ждать пока он не выйдет из отпуска
